import React, { Component } from 'react'
import Axios from 'axios'
export default class Homepage extends Component {
  constructor(props) {
    super(props)
    this.state = {
      data: [],
    }
  }

  componentDidMount() {
    Axios.get(`https://itunes.apple.com/us/rss/topalbums/limit=100/json`)
      .then((res) => {
        console.log(res)
        this.setState({
          data: res.data.feed.entry,
        })
      })
      .catch((err) => console.log(err))
  }

  onhh = () => {
    console.log(this.state.data[0]['im:name'].label)
  }

  render() {
    return (
      <div>
        <button type='button' class='btn btn-primary' onClick={this.onhh}>
          Primary
        </button>
        <div className='row'>
          {this.state.loading == false ? (
            <div>
              {this.state.data.map((song) => {
                return (
                  <div className='col-12 col-sm-6 col-md-4 col-lg-3'>
                    <div class='card' style={{ width: '18em' }}>
                      <img
                        class='img-fluid '
                        src='https://picsum.photos/id/237/200/100'
                        alt='...'
                      />
                      <div class='card-body'>
                        <h5 class='card-title'>{song['im:name'].label}</h5>
                        <p class='card-text'>
                          Some quick example text to build on the card title and
                          make up the bulk of the card's content.
                        </p>
                        <a href='#' class='btn btn-primary'>
                          Go somewhere
                        </a>
                      </div>
                    </div>
                  </div>
                )
              })}
            </div>
          ) : (
            ''
          )}
        </div>
      </div>
    )
  }
}
